import React from 'react';

const Tweet = ({tweets}) => (

    <>
        <div>
            {tweets.map((thistweet, key) => 
                <div key={key} className="tweet-style">
                    <img src={thistweet.user.profile_image_url} alt="not found" className="tweet-img"/>
                    <span>{thistweet.user.screen_name}</span>
                    <span>@{thistweet.user.name}</span>
                    <p>{thistweet.created_at}</p>
                    <p>{thistweet.text}</p>     
                </div>
            )}
        </div> 
    </>
)

export default Tweet;
